package com.vk2.touchsreentab.model;import com.google.gson.annotations.SerializedName;import java.util.List;public class ResultSoundCloud {    @SerializedName("collection")    private List<SoundCloudObject> soundCloudObject;    @SerializedName("next_href")    private String nextpage;    public ResultSoundCloud() {    }    public List<SoundCloudObject> getSoundCloudObject() {        return soundCloudObject;    }    public void setSoundCloudObject(List<SoundCloudObject> soundCloudObject) {        this.soundCloudObject = soundCloudObject;    }    public String getNextpage() {        return nextpage;    }    public void setNextpage(String nextpage) {        this.nextpage = nextpage;    }}